  \"2016-11-25T21:06:15.108932\",\n\t\"name\": \"elementary-school-arts-education-survey-2009\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"The Elementary School Arts Education Survey,
  2009 (FRSS 100), is a study that is part of the Quick Response Information System.
  FRSS 100 (http://nces.ed.gov/surveys/frss/) is a sample survey that provides national
  estimates on student access to arts education and resources available for such instruction
  in public elementary schools during fall 2009. The study was conducted using mailed
  questionnaires that could be completed via web or by mail. Follow-up telephone interviews
  were also conducted. Principals of elementary schools were sampled. The study's
  response rate was 85 percent. Key statistics produced from FRSS 100 are availability
  and characteristics of music, visual arts, dance, and drama/theatre instruction;
  the type of space used for arts instruction; the availability of curriculum guides
  for arts teachers to follow; and whether those teaching the subject are arts specialists.\",\n\t\"license_title\":
